import React from "react";
import { Button, Input } from "../conponents";
import {getLogin, getUsers} from '../conponents/server'
function Login() {
  const [email, setEmail] = React.useState("");
  const [password, setPassword] = React.useState("");

  return (
    <div className="authorization">
      <h2>Log In</h2>
      <div className="form">
        <form>
                  <Input
                      value={email}
                      onChange={(e) => setEmail(e.target.value)}
                      type='text'
                      label='email'
                      placeholder="E-mail Address"
                  />
                  <Input
                      value={password}
                      onChange={(e) => setPassword(e.target.value)}
                      type='password'
                      label='password'
                      placeholder="Password"
          />
                       <Button
          type='button'
          onClick={getUsers(email, password)}
        >
                  login
              </Button>
              </form>



                    </div>
    </div>
  );
}

export default Login;
